import React from "react";
import "../../about_page_style.css";
import "../../post_page_style.css";
const Post = () => {
  return (
    <div>
      <section className="height_video_fullscreen background_blog p-0">
        <div className="position-relative w-100 z_index_1 padding_x_high height_video_fullscreen backgroud_dark_opacity">
          <h1 className="text-light font_weight_boldest head_line_height head_size_high padding_top_10">
            BLOG SINGLE
          </h1>
          <span className="font_family_span font_color_span head_span_size_normal mb-5 font_weight_normal">
            ~ The things you want to find ~
          </span>
        </div>
      </section>
      <section className="container">
        <div className="row">
          <div className="col-lg-9 bg-danger">post</div>
          <div className="col-lg-3 bg-dark">sidebar</div>
        </div>
      </section>
    </div>
  );
};

export default Post;
